import React from 'react';
import './Sidebar/Sidebar';
import Form from './Form//Form';
import Table from './Table/Table';

function MainBody({ selectedLink }) {
  return (
    <>
      {selectedLink === 'form' ? (
        <Form />
      ) : selectedLink === 'table' ? (
        <Table />
      ) : (
        <h2 style={{ padding: '50px' }}>Select a menu</h2>
      )}
    </>
  );
}

export default MainBody;
